import React from 'react';

function Contact() {
  return (
    <section id="contact">
      <h2>Contact Me</h2>
      <div className="contact-options">
        <p>You can reach me through the following:</p>
        <ul>
          <li>
            <a href="mailto:chahalpranav2312@gmail.com" target="_blank" rel="noopener noreferrer">Email Me</a>
          </li>
          <li>
            <a href="https://www.linkedin.com/in/pranav-chahal/" target="_blank" rel="noopener noreferrer">LinkedIn</a>
          </li>
        </ul>
      </div>
    </section>
  );
}

export default Contact;
